import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import * as serviceWorker from './serviceWorker';
import firebase from 'firebase';
import { Provider } from 'react-redux';
import store from './store';


// Your web app's Firebase configuration
const firebaseConfig = {
  apiKey: "AIzaSyAiZ0K2ir1DCHrGvywR6xFZ_H-80_ZjPkQ",
    authDomain: "reactinstatutorial-a187a.firebaseapp.com",
    databaseURL: "https://reactinstatutorial-a187a-default-rtdb.firebaseio.com",
    projectId: "reactinstatutorial-a187a",
    storageBucket: "reactinstatutorial-a187a.appspot.com",
    messagingSenderId: "296355912515",
    appId: "1:296355912515:web:2bc950c719b318af59adf6"
};


firebase.initializeApp(firebaseConfig);

window.store = store;

ReactDOM.render(
  <Provider store={store}>
    <React.StrictMode>
      <App />
    </React.StrictMode>
  </Provider>,
  document.getElementById('root')
);

// If you want your app to work offline and load faster, you can change
// unregister() to register() below. Note this comes with some pitfalls.
// Learn more about service workers: https://bit.ly/CRA-PWA
serviceWorker.unregister();
